  false,\n\t\"url\": null,\n\t\"notes\": \"Fish kills have become a focus of public
  attention as more interest is placed on the quality and condition of Iowa's streams
  and rivers. The Integrated Report, which combines federal requirements for state
  Section 305(b) water quality assessments and Section 303(d) impaired waters listings,
  required the Iowa Department of Natural Resources Watershed Monitoring and Assessment
  Section to begin tracking fish kills. A fish kill can affect the 305(b) water quality
  assessment of the waterbody and can potentially result in the addition of the water
  body to the 303(d) list of impaired waters.  The  online database stores the data
  for all fish kills in the state from 1995 to the present.\",\n\t\"license_title\":
